  function initControl() {
    $('canvas').on('touchstart', onDocumentTouchStart);
    $('canvas').on('mousedown', onDocumentMouseDown);
    $('canvas').on('touchstart', firstPlay);
    $('canvas').on('mousedown', firstPlay);
    $('canvas').on('focus', function() {
      if (!isPlay) playOn()
    });
    $('canvas').on('blur', function() {
      if (isPlay) playOff()
    });
  }

  function firstPlay() {
    $('canvas').off('touchstart', firstPlay);
    $('canvas').off('mousedown', firstPlay);
  }

  function onDocumentTouchStart(event) {
    introOff();
    isDown = true;
    event = event.touches[0];
    actionStart(event.clientX, event.clientY);
    $(document).on('touchmove', onDocumentTouchMove, {
      passive: false
    });
    $(document).on('touchend', onDocumentTouchEnd);
    return false
  }

  function onDocumentTouchMove(event) {
    event = event.touches[0];
    actionMove(event.clientX, event.clientY);
    return false
  }

  function onDocumentTouchEnd() {
    isDown = false;
    $(document).off('touchmove', onDocumentTouchMove);
    $(document).off('touchend', onDocumentTouchEnd);
    return false
  }

  function onDocumentMouseDown(event) {
    introOff();
    isDown = true;
    actionStart(event.clientX, event.clientY);
    $(document).on('mousemove', onDocumentMouseMove);
    $(document).on('mouseup', onDocumentMouseUp);
    return false
  }

  function onDocumentMouseMove(event) {
    actionMove(event.clientX, event.clientY);
    return false
  }

  function onDocumentMouseUp(event) {
    isDown = false;
    $(document).off('mousemove', onDocumentMouseMove);
    $(document).off('mouseup', onDocumentMouseUp);
    return false
  }

  function actionStart(x, y) {
    onDownPointerX = x;
    onDownPointerY = y;
    onDownLon = target.lon;
    onDownLat = target.lat;
    mouse.x = (x / stageW) * 2 - 1;
    mouse.y = -(y / stageH) * 2 + 1;
    checkSelect()
  }

  function actionMove(x, y) {
    target.lon = (x - onDownPointerX) * 0.5 + onDownLon;
    target.lat = (y - onDownPointerY) * 0.5 + onDownLat
  }

