  // Marquee 滚动
  function verticalMarquee(el, length) {
    var noAnimate = false
    var currentIndex = 0
    var marqueeTimer = null
    var currenTranslateY = 0
    if (marqueeTimer) clearInterval(marqueeTimer)
    marqueeTimer = setInterval(function() {
      if (currentIndex < length - 3) {
        noAnimate = false
        currentIndex += 1
        currenTranslateY = -(currentIndex * 48)
      } else {
        noAnimate = true
        currentIndex = 0
        currenTranslateY = 0
      }
      el.css({
        'transition': 'transform ' + (noAnimate ? 0 : 1000) + 'ms ease 0s',
        'transform': 'translate3d(0,' + currenTranslateY + 'px,0)'
      })
    }, 3000)
  }
